Diagnosis.
Anastrepha surinamensis
can be distinguished from other species of
Anastrepha
by the following combination of characters: Subscutellum and mediotergite without brown markings; V-band incomplete, distal arm present but not extended to vein R 4+5 ; oviscape 2.24–2.92 mm long, 0.86–0.96 times as long as mesonotum; aculeus 2.06–2.52 mm long, tip 0.18–0.22 mm long, 0.06–0.08 mm wide, distal 0.61–0.75 distinctly serrate. It resembles
A. irretita Stone
, but differs in having a narrower aculeus tip (
0.084 –0.094 mm
wide in
A. irretita
) with the proximal serrations slightly dorsally curved, and incomplete V-band;
A. fischeri
Lima , but differs in having a slightly longer aculeus tip (approximately 0.15 mm long in
A. fischeri
) and incomplete V-band;
A. macra Stone
, but differs in having shorter terminalia (aculeus 3.60–4.06 mm long in
A. macra
), shorter and more serrate aculeus tip ( 0.36–0.39 mm long with distal 0.41–0.49 serrate in
A. macra
), and lacking lateral brown markings on the mediotergite (variable in
A. macra
);
A. cicra Norrbom
, but differs in lacking lateral brown markings on the mediotergite, having the distal arm of the V-band partially present, shorter terminalia (aculeus 3.70–4.37 mm long in
A. cicra
), and a shorter aculeus tip ( 0.30–0.33 mm long in
A. cicra
); and
A. gangadini Norrbom
, but differs in having a shorter aculeus tip ( 0.19–0.22 mm long vs. 0.34–0.36 in
A. gangadini
).
